import React from "react";
import { Link } from "react-router-dom";

import "./navbar.scss";

const Navbar = ({ tabs }) => {
  return (
    <nav class="navbar my-navbar navbar-expand-lg navbar-light bg-light">
      <button className="btn navbar-brand">Workspace</button>
      <div class="collapse navbar-collapse" id="navbarNav">
        <ul class="navbar-nav">
          {tabs.map((tab) => (
            <li key={tab._id} class="nav-item">
              <Link class="nav-link" to={tab.path}>
                {tab.title}
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
